type CustomPathElementProps = {
  title: string;
  onClick?: (
    props: CustomPathElementProps &
      typeof regions[number] & { event: React.MouseEvent<SVGPathElement> }
  ) => void;
  onMouseOver?: (
    props: CustomPathElementProps &
      typeof regions[number] & { event: React.MouseEvent<SVGPathElement> }
  ) => void;
} & Omit<SVGProps<SVGPathElement>, "onMouseOver" | "onMouseMove" | "onClick"> &
  typeof regions[number];

const CustomPathElement = ({
  title,
  onClick,
  onMouseOver,
  ...props
}: CustomPathElementProps) => {
  return (
    <path
      {...props}
      style={{ transition: "inherit", ...props.style }}
      tabIndex={0}
      onClick={(event) => {
        event.stopPropagation();
        if (typeof onClick === "function") {
          onClick({
            ...props,
            onMouseOver,
            title,
            event
          });
        }
      }}
      onMouseMove={(event) => {
        event.stopPropagation();
        if (typeof onMouseOver === "function") {
          onMouseOver({
            ...props,
            onMouseOver,
            title,
            event
          });
        }
      }}
    />
  );
};

